window.bookSummaryJSON = "<p><b>Terran Strike Marines fight for victory. No matter the odds. No matter the cost. </b></p> <p>The final battle against the Kesaht begins.</p> <p>Lieutenant Hoffman and the exhausted Marines of Valdar's Hammer are called upon to make a desperate assault against the enemy's home world. But the foe is prepared, and their planet is a death trap.</p> <p>While the Strike Marines fight for their lives, the fabled ship <i>Breitenfeld</i> remains captured by the Ibarra Nation, and the Ember War hero Valdar languishes in a cell. The ship and her captain are held on a strange world of the Ibarra's design, and only the Hammers can free them.</p> <p>Hoffman and his Strike Marines have fought from the icy wastes of Koen, to the jungles of Eridu, and even deep into the heart of a shattered moon, but their final mission will demand a price in blood.</p> <p>From the Dragon Award-winning, and Nebula Award-nominated Richard Fox and Scott Moon, <i>Gott Mit Uns</i> throws the Terran Strike Marines into the fight of their lives.&nbsp;</p> <p>The thrilling final installment in the Terran Strike Marines series.</p>"; 
